//@ts-nocheck
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import React from 'react';
import {StyleSheet, Text} from 'react-native';


const styles = {

  ContentStyles:{

  },
  paper: {
    padding: 10,
    textAlign: 'center',
    color: '#000',
  }
}

type cardprops={
  children?: React.ReactNode
  cardData?: any
  ContentHeaderStyles?:any
  ContentTitleStyles?:any
  ContentDescriptionStyles?:any
  ContentIconStyles?:any
}

export const CardDisplayV = (props:cardprops) => {
  const _getCards = () => {

    const _tempData:any = [];
  // eslint-disable-next-line no-unused-expressions
    Array.isArray(props?.cardData) && props?.cardData.forEach(item=>{
      _tempData.push(
        <Grid item xs={12} sm={6} md={3}>
          <Paper style={StyleSheet.flatten(styles.paper)}>
            <Text>{item.planName}</Text>
            <hr/>
             <ul>
             {_getServices()}
             </ul>
            <Text>{item.amount}</Text>
             <br/>
             <button>Chooseplan</button>
           </Paper>
        </Grid>
      )
    });
    return _tempData;
  }

  return(
    <Grid container justify={"center"} alignItems={"center"} >
      <Grid item xs={11}>
      <Grid container justify={"center"} alignItems={"center"} spacing={4}>
      {_getCards()}
      </Grid>
      </Grid>
    </Grid>
  )
}
